import './index.css';
import './App.css';
import Navbar from './component/navbar/Navbar';
import AdminHomepage from './pages/AdminHomepage';
import AllMobiles from './pages/Allmobiles';
import Home from './pages/Home';
import { BrowserRouter, Route, Routes, useLocation } from 'react-router-dom';
import AdminLogin from './pages/adminpages/login/AdminLogin';
import { useState } from 'react';
import Signup from './pages/adminpages/signup/Signup';

function App() {
  const location = useLocation();

  const [user, setuser] = useState('user')




  return (
    <div className="App">



      <Route path='/admin/santu/signup' element={<Signup />} />
      <Routes>
        <Route exact path='/admin/santu' element={<AdminLogin />} />

          <Route exact path='adminhome' element={<AdminHomepage />} >
          <Route path='mobiles' element={<AllMobiles />} />
          <Route path='head-phones' element={<AllMobiles />} />
          <Route path='accessories' element={<AllMobiles />} />
          <Route path='smart-watches' element={<AllMobiles />} />
        </Route>



        <Route path='/admin/santu/signup' element={<Signup />} />



        <Route exact path='/home' element={<Home />} />
        <Route path='/all-mobiles' element={<AllMobiles />} />

      </Routes>
    </div>
  );
}

function AppWrapper() {
  return (
    <BrowserRouter>
      <App />
    </BrowserRouter>
  );
}

export default AppWrapper;
